import React from 'react'
import classes from './Instagram.module.css'
import { connect } from 'react-redux'



const Instagram = (props) =>{
	//			{props.img.map( el => { return <div className={classes.img}><img src={el.src} key={el.src}/></div>})}

	return <section className={classes.section}>
		<div className={classes.Top}>
			<img src={process.env.PUBLIC_URL + `/img/images/index_37.jpg`}/>
			<div>Instagram feed:</div> 
			<h1>#surfhouse</h1>
		</div>
		<div className={classes.Center}>
		</div>
		<div></div>
		<div></div>
		<div></div>
		<div></div>
	</section>
}


const mapStateToProps = (state) => {
	debugger
    return{
    	img: state.InstagramReducer.img
    }
}

export default connect(mapStateToProps,{})(Instagram)
